import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Memberships = () => {
  const [memberships, setMemberships] = useState([]);

  // Fetch memberships data from the backend when the component mounts
  useEffect(() => {
    axios.get('/memberships')
      .then(response => {
        setMemberships(response.data);
      })
      .catch(error => {
        console.error('There was an error fetching the memberships!', error);
      });
  }, []);

  return (
    <div>
      <h1>Memberships</h1>

      {/* Navigation Links */}
      <nav>
        <a href="/memberships">Memberships</a> | <a href="/customers">Customers</a> | 
        <a href="/payments">Payments</a> | <a href="/movies">Movies</a> | 
        <a href="/rentals">Rentals</a>
      </nav>

      {/* Memberships Table */}
      <div id="browse" style={{ display: 'block' }}>
        <p><strong>Browse Memberships</strong></p>
        {memberships.length === 0 ? (
          <p>No memberships found.</p>
        ) : (
          <table border="1" cellPadding="5">
            <thead>
              <tr>
                <th>Membership ID</th>
                <th>Membership Type</th>
                <th>Membership Discount</th>
              </tr>
            </thead>
            <tbody>
              {memberships.map((membership) => (
                <tr key={membership.membership_id}>
                  <td>{membership.membership_id}</td>
                  <td>{membership.membership_type}</td>
                  <td>{membership.membership_discount}</td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>

      {/* Insert Form (for adding new memberships) */}
      <div id="insert" style={{ display: 'block' }}>
        <form id="addMembership">
          <legend><strong>Add Membership</strong></legend>
          <fieldset className="fields">
            <label> Membership Type </label> 
            <input type="text" name="membership_type" />
            <label> Membership Discount </label> 
            <input type="text" name="membership_discount" />
          </fieldset>
          <input className="btn" type="submit" id="addMembership" value="Add Membership" />
          <input className="btn" type="button" value="Cancel" />
        </form>
      </div>

      {/* Update Form (for updating memberships) */}
      <div id="update" style={{ display: 'block' }}>
        <form id="updateMembership">
          <legend><strong>Update Membership</strong></legend>
          <fieldset className="fields">
            <label>Membership ID:</label> 
            <input type="text" name="membership_id" />
            <label> Membership Type </label> 
            <input type="text" name="membership_type" />
            <label> Membership Discount </label> 
            <input type="text" name="membership_discount" />
          </fieldset>
          <input className="btn" type="submit" id="UpdateSaveMembership" value="Save Update Membership" />
          <input className="btn" type="button" value="Cancel" />
        </form>
      </div>

      {/* Delete Form (for deleting memberships) */}
      <div id="delete" style={{ display: 'block' }}>
        <form id="deleteMembership">
          <legend><strong>Delete Membership</strong></legend>
          <fieldset className="fields">
            <p>Are you sure you wish to delete the following?</p>
            <label>Membership ID:</label> 
            <input type="text" name="membership_id" />
          </fieldset>
          <input className="btn" type="submit" id="DeleteMembership" value="Delete Membership" />
          <input className="btn" type="button" value="Cancel" />
        </form>
      </div>
    </div>
  );
};

export default Memberships;
